<ul>
<li>@ 关闭单行回显</li>
<li>echo off 从下一行开始关闭回显</li>
<li>@echo off 从本行开始关闭回显（一般的脚本都以这个开头）</li>
<li>echo on 从下一行开始打开回显</li>
<li>echo 显示当前是echo off 还是echo on</li>
<li>echo.输出一个 “回车换行”，空白行</li>
</ul>
